import React, {useState} from "react"
import {
    Switch,
    Route,
    useRouteMatch
  } from "react-router-dom";
import '../css/main.css';
import Navbar from './MainComponents/Navbar'
import Inventory from './MainComponents/Inventory'
import Account from './MainComponents/Account'
import Order from './MainComponents/Order'
import Business from './MainComponents/Business'

const Main = (props) =>{
    
    return(
        <div id="main">
            <Navbar />
            <div className="main-content">
                <Route exact path={["/main","/main/inventory"]} component={Inventory} />
                <Route exact path={["/main/order"]} component={Order} />
                <Route exact path={["/main/business"]} component={Business} />
                <Route exact path={["/main/account"]} component={Account} />
            </div>
        </div>
    )        
}

export default Main;
